import React from 'react';
import {
  LineSeries, Tooltip,
  ChartProvider, XAxis, YAxis,
} from 'rough-charts'

const Beer = () => {
  const data = [
    { name: 'A', value1: 30, value2: 35 },
    { name: 'B', value1: 90, value2: 17 },
    { name: 'C', value1: 50, value2: 23 },
    { name: 'D', value1: 40, value2: 15 },
    { name: 'E', value1: 70, value2: 39 },
    { name: 'G', value1: 30, value2: 25 },
    { name: 'H', value1: 100, value2: 31 },
    { name: 'I', value1: 110, value2: 32 },
  ]

  return (
    <div className="container">
        <div className="row">
          <div className="col-12 text-center">
            <h1>Beer</h1>
          </div>
          <div className="col-12">
            <ChartProvider
              xScale={d3Scale.scaleLinear().domain([120, 200])}
              data={data}
              height={400}
              {...props}
            >
              <YAxis dataKey="weight" format={tick => `${tick} kg`} />
              <XAxis dataKey="height" format={tick => `${tick} cm`} />
              <CircleSeries
                dataKey="weight"
              >
                {(item, itemProps, index) => (
                  <Circle
                    key={index}
                    {...itemProps}
                    diameter={10 + index * 5}
                    options={{
                      fill: colors[index % colors.length],
                    }}
                  />
                )}

              </CircleSeries>
              <Tooltip />
            </ChartProvider>            
          </div>
        </div>
    </div>
  )
}

export default (Beer);
